Story continued from the Adventures of Superman #516.  ZERO HOUR's impact on the Man of Steel worsens when the timestream collapses...and the entire city of Metropolis blinks out of existence! And as he races to Smallville, he finds his hometown intact--but drastically different!  Story continues in Zero Hour #1.

